import React, {Component, Fragment} from 'react';
import classes from './Layout.module.sass';

class Layout extends Component {
    render() {
        return (
            <Fragment>
                <main className={classes.Content}>{this.props.children}</main>
            </Fragment>
        );
    }
}

export default Layout;
